public void syntax_error(Symbol s){
        
        System.out.println("Error Sintctico en la Lnea " + (s.left) +
        " Columna "+s.right+ ". No se esperaba este componente: " +s.value+"."); 
        //agregar a errores
        errores.add(new ErrorLSS(s.left,s.right,"Sintactico","No se esperaba el simbolo "+s.value));
    }

    /**
     * Mtodo al que se llama automticamente ante algn error sintctico 
     * en el que ya no es posible una recuperacin de errores.
     **/ 
    public void unrecovered_syntax_error(Symbol s) throws java.lang.Exception{ 
        System.out.println("Error sntactico irrecuperable en la Lnea " + 
        (s.left)+ " Columna "+s.right+". Componente " + s.value + 
        " no reconocido."); 

        errores.add(new ErrorLSS(s.left,s.right,"Sintactico","No se esperaba el simbolo "+s.value));
    }

    public ArrayList<Nodo> getNodos(){
        return nodos;
    }

    public ArrayList<ErrorLSS> getErrores(){
        return errores;
    }

    public Controlador getControl(){
        return control;
    }



